import React from 'react';

function Question({ q, index }) {
    return (
        <div>
            <p>{q.text}</p>
            <label>True </label><input type="radio" name={`question${index}`} />
            <label>False </label><input type="radio" name="answer" />
        </div>
    )
}

export default Question
